class Example extends Phaser.Scene {
    preload() {
        let jackpotImageData = "data:image/png;base64,";

        let bonusCardImageData = "data:image/png;base64,"
        
        this.coinimageData = "data:image/png;base64,"
        
        let bonusOverlayImageData = "data:image/png;base64,"
        let interFace1TextImageData = "data:image/png;base64,"
        let ticketImageData = "data:image/png;base64,"
        let cardImageData = "data:image/png;base64,"
        let cardOverlayImageData = "data:image/png;base64,"
        let brushImageData = "data:image/png;base64,"
        let runnerTextDataImage = "data:image/png;base64,"
        let installNowDataImage = "data:image/png;base64,"
        
        this.textures.addBase64("jackpot", jackpotImageData);
        this.textures.addBase64("bonusCardImage", bonusCardImageData);
        this.textures.addBase64("coin", this.coinimageData);
        this.textures.addBase64("bonusOverlay", bonusOverlayImageData);
        this.textures.addBase64("interface1Text", interFace1TextImageData);
        this.textures.addBase64("ticket", ticketImageData);
        this.textures.addBase64("card", cardImageData);
        this.textures.addBase64("cardOverlay", cardOverlayImageData);
        this.textures.addBase64("brush", brushImageData);
        this.textures.addBase64("runnerText", runnerTextDataImage);
        this.textures.addBase64("installNowButton", installNowDataImage);

        this.load.setBaseURL("http://labs.phaser.io");
        this.load.image("workaround", "assets/pics/turkey-1985086.jpg");
        
    }
    create() {
        let jackpot = this.add.image(
            350,
            250,
            "jackpot"
        );

        jackpot.displayWidth = 690;
        jackpot.displayHeight = 470;
        
        this.bonusCardImage = this.add.image(
            350,
            800,
            "bonusCardImage"
        );
        this.bonusCardImage.displayWidth = 520;
        this.bonusCardImage.displayHeight = 350;
        this.bonusCardImage.setInteractive({ cursor: "coin, pointer" });

        this.rt = this.add.renderTexture(
            350,
            800,
            520,
            350
        );
        let brush = this.make.image({ key: "brush",}, false).setScale(0.4);

        let bonusOverlay = this.rt.draw("bonusOverlay", 0, 5);
        this.rt.on("pointermove", (pointer) => {
            this.game.canvas.style.cursor = `url(${this.coinimageData}), auto`;
        });
    

        this.input.on("pointermove", (pointer) => {
            if(pointer.isDown) {
                this.rt.erase(brush, pointer.x - 25, pointer.y - 560);
            }
        })
        
        this.input.on("pointerdown", (pointer) => {
            if(pointer.isDown) {
            this.rt.erase(brush, pointer.x - 25, pointer.y - 560);
            }
        });

        bonusOverlay.setInteractive({
            cursor: "url(assets/input/cursors/pen.cur, pointer",
        });


        let interFace1Text = this.add.image(
            1210,
            180,
            "interface1Text"
        );
        interFace1Text.displayWidth = 1000;
        interFace1Text.displayHeight = 180;

        let ticketAnimation = this.add.image(
            interFace1Text.displayWidth + 200,
            100,
            "ticket"
        );

        let scaleText = 0.5;
        let direction = 1;
        this.tweens.addCounter({
            from: 1,
            to: 5,
            duration: 400,
            ease: "Sine.easeInOut",
            repeat: -1,
            yoyo: true,
            onUpdate: (tween) => {
              scaleText = 1 + tween.getValue() / 50;
            },
          });
      
        this.time.addEvent({
        delay: 17,
        loop: true,
        callback: () => {
            ticketAnimation.setScale(scaleText);
            ticketAnimation.setPosition(
            interFace1Text.displayWidth + 200,
            100
            );
            ticketAnimation.setDisplaySize(
            150 * scaleText,
            120 * scaleText
            );
            scaleText += 0.01 * direction;
        },
        });

        
        let card = this.add.image(
            1210,
            650,
            "card"
        );
        // const rt3 = this.add.renderTexture(card.displayWidth-150, 490, 180, 130);
        // rt3.fill(0x00ff00);
        // rt3.angle = 155
        
        // const rt4 = this.add.renderTexture(card.displayWidth+510, 490, 180, 130);
        // rt4.fill(0x00ff00);
        // rt4.angle = 155
        // const rt5 = this.add.renderTexture(card.displayWidth+180, 815, 180, 130);
        // rt5.fill(0x00ff00);
        // rt5.angle = 155
        card.displayWidth = 1000;
        card.displayHeight = 650;
        let ticketArr = [];
        let ticket1 = this.add.image(
            card.displayWidth-128,
            480,
            "ticket"
        );
        ticketArr.push(ticket1)
        ticket1.displayWidth = 272;
        ticket1.displayHeight = 240;
        ticket1.angle = -5
        
        let ticket2 = this.add.image(
            card.displayWidth+538,
            486,
            "ticket"
        );
        ticketArr.push(ticket2)
        ticket2.displayWidth = 272;
        ticket2.displayHeight = 240;
        ticket2.angle = -5;
        let ticket3 = this.add.image(
            card.displayWidth+210,
            813,
            "ticket"
        );
        ticket3.displayWidth = 272;
        ticket3.displayHeight = 240;
        ticket3.angle = -5
        ticketArr.push(ticket3)
        card.setInteractive({ cursor: "coin, pointer" });
        this.rt1 = this.add.renderTexture(
            1210,
            650,
            1000,
            650
        );

        
        this.rt1.on("pointermove", (pointer) => {
            this.game.canvas.style.cursor = `url(${this.coinimageData}), auto`;
        });

        let cardOverlay = this.rt1.draw("cardOverlay", -20, -20)
        cardOverlay.displayWidth = card.displayWidth - 40
        cardOverlay.displayHeight = card.displayHeight - 40
        this.gameOver = false
        let winingTickets = [];
        let ticket1Win;
        let ticket2Win;
        let ticket3Win;

        this.input.on("pointermove", (pointer) => {
            if(this.gameOver === false && pointer.isDown) {
                if (
                    Math.abs(card.displayWidth-150 - pointer.x) <= 100 &&
                    Math.abs(480- pointer.y) <= 60
                ) {
                    winingTickets.push("ticket1")
                }
                if (
                    Math.abs(card.displayWidth+510 - pointer.x) <= 100 &&
                    Math.abs(480 - pointer.y) <= 60
                ) {
                    winingTickets.push("ticket2")
                    }
                if (
                    Math.abs(card.displayWidth+180 - pointer.x) <= 100 &&
                    Math.abs(810 - pointer.y) <= 60
                ) {
                    winingTickets.push("ticket3")
                }

                ticket1Win = typeof winingTickets.find((elem) => elem === "ticket1");
                ticket2Win = typeof winingTickets.find((elem) => elem === "ticket2");
                ticket3Win = typeof winingTickets.find((elem) => elem === "ticket3");
                setTimeout(() => {
                    if (
                      ticket1Win === "string" &&
                      ticket2Win === "string" &&
                      ticket3Win === "string"
                    ) {
                      this.gameOver = true;
                    }
                  }, 1000);       
                this.rt1.erase(brush, pointer.x - 670, pointer.y - 250);
    
            }
        })
        
        this.input.on("pointerdown", (pointer) => {
            if(this.gameOver === false) {
                if (
                    Math.abs(card.displayWidth-150 - pointer.x) <= 100 &&
                    Math.abs(480- pointer.y) <= 60
                ) {
                    winingTickets.push("ticket1")
                }
                if (
                    Math.abs(card.displayWidth+510 - pointer.x) <= 100 &&
                    Math.abs(480 - pointer.y) <= 60
                ) {
                    winingTickets.push("ticket2")
                    }
                if (
                    Math.abs(card.displayWidth+180 - pointer.x) <= 100 &&
                    Math.abs(810 - pointer.y) <= 60
                ) {
                    winingTickets.push("ticket3")
                }
                this.rt1.erase(brush, pointer.x - 650, pointer.y - 250);

                ticket1Win = typeof winingTickets.find((elem) => elem === "ticket1");
                ticket2Win = typeof winingTickets.find((elem) => elem === "ticket2");
                ticket3Win = typeof winingTickets.find((elem) => elem === "ticket3");

                setTimeout(() => {
                    if (
                    ticket1Win === "string" &&
                    ticket2Win === "string" &&
                    ticket3Win === "string"
                    ) {
                        setTimeout(() => {
                        this.gameOver = true;
                        this.tweens.add({
                            targets: card,
                            x: 4000,
                            duration: 800,
                            ease: "Back.In",
                            onComplete: () => {
                              card.destroy();
                            },
                            
                        });
                        this.tweens.add({
                            targets: jackpot,
                            x: 4000,
                            duration: 800,
                            ease: "Back.In",
                            onComplete: () => {
                                jackpot.destroy();
                            },
                        });
                        this.tweens.add({
                            targets: this.bonusCardImage,
                            x: 4000,
                            duration: 800,
                            ease: "Back.In",
                            onComplete: () => {
                                this.bonusCardImage.destroy();
                            },
                        });
                        this.tweens.add({
                            targets: ticketAnimation,
                            x: 4000,
                            duration: 800,
                            ease: "Back.In",
                            onComplete: () => {
                                ticketAnimation.destroy();
                            },
                        });
                        this.tweens.add({
                            targets: interFace1Text,
                            x: 4000,
                            duration: 800,
                            ease: "Back.In",
                            onComplete: () => {
                                interFace1Text.destroy();
                            },
                        });
                        this.tweens.add({
                            delay: 1000,
                          targets: ticket1,
                          x: this.cameras.main.width / 2,
                          y: this.cameras.main.height / 2 - 60,
                          duration: 600,
                          ease: "Power3",
          
                          onComplete: () => {
                            setTimeout(() => {
                                }, 100);
                            }
                        })
                        this.tweens.add({
                            delay: 2200,
                          targets: ticket2,
                          x: this.cameras.main.width / 2,
                          y: this.cameras.main.height / 2-60,
                          duration: 300,
                          ease: "Power3",
          
                          onComplete: () => {
                            setTimeout(() => {
                                ticket2.destroy();
                                ticket3.destroy();
                                }, 1500);
                            }
                        })
                        this.tweens.add({
                            delay: 3500,
                          targets: ticket3,
                          x: this.cameras.main.width / 2,
                          y: this.cameras.main.height / 2 - 60,
                          duration: 600,
                          ease: "Power3",
                        })
                        this.tweens.add({
                            targets: ticket1,
                            ease: "Elastic.Out",
                            scaleX: 2,
                            scaleY: 2,
                            delay: 4300,
                            duration: 2500,
                            repeat: 0,
                            onComplete: () => {
                                let runnerText = this.add.sprite(
                                    -1000,
                                    680,
                                    "runnerText"
                                );
                                runnerText.displayWidth = 800
                                runnerText.displayHeight = 100
                                this.tweens.add({
                                    targets: runnerText,
                                    x: card.displayWidth-50,
                                    ease: "Bounce.Out",
                                    duration: 1000,
                                    repeat: 0,
                                    onComplete: () => {
                                    this.tweens.add({
                                        targets: ticket1,
                                        x: 4000,
                                        duration: 1000,
                                        ease: "Back.In",
                                        onComplete: () => {
                                            ticket1.destroy();
                                        },
                                    })
                                    this.tweens.add({
                                        targets: runnerText,
                                        x: 4000,
                                        duration: 1000,
                                        ease: "Back.In",
                                        onComplete: () => {
                                            setTimeout(() => {
                                                runnerText.destroy();
                                                jackpot = this.add.image(card.displayWidth-50, 350, "jackpot")
                                                jackpot.displayWidth = 690;
                                                jackpot.displayHeight = 470;
                                                this.tweens.add({
                                                    targets: jackpot,
                                                    scale: 1.2,
                                                    duration: 2000,
                                                    ease: "Elastic.Out",
                                                    repeat: 0,
                                                });
                                                
                                                let installNowButton = this.add.image(card.displayWidth-50, 800, "installNowButton")
                                                this.tweens.add({
                                                    targets: installNowButton,
                                                    delay: 500,
                                                    scaleX: 1.2,
                                                    scaleY: 1.2,
                                                    duration: 2000,
                                                    ease: "Elastic.Out",
                                                    repeat: 0,
                                                    onComplete: () => {
                                                     let scaleText = 0.5;
                                                    let direction = 1;
                                                    this.tweens.addCounter({
                                                        from: 1,
                                                        to: 5,
                                                        duration: 400,
                                                        ease: "Sine.easeInOut",
                                                        repeat: -1,
                                                        yoyo: true,
                                                        onUpdate: (tween) => {
                                                        scaleText = 1 + tween.getValue() / 50;
                                                        },
                                                    });
                                                
                                                    this.time.addEvent({
                                                    delay: 1,
                                                    loop: true,
                                                    callback: () => {
                                                        installNowButton.setScale(scaleText);
                                                        installNowButton.setPosition(
                                                        card.displayWidth-50,
                                                        800
                                                        );
                                                        installNowButton.setDisplaySize(
                                                        450 * scaleText,
                                                        120 * scaleText
                                                        );
                                                        scaleText += 0.01 * direction;
                                                    },
                                                    });

                                                    }
                                                });  
                                            }, 10);
                                            
                                        },
                                    })
                                    
                                }
                                });

                              }
                          });
                          
                        }, 1000);

                    }
                }, 1000);
            }
        })
        cardOverlay.setInteractive({
            cursor: "url(assets/input/cursors/pen.cur, pointer",
        });
    }
    update() {
        if (this.gameOver === true) {
          this.rt.alpha -= 0.03;
          this.rt1.alpha -= 0.03;
          if (this.rt.alpha < 0) {
            this.rt.alpha = 0;
            this.rt1.alpha = 0;
          }
          this.rt.alpha = this.rt.alpha;
        }
      }
}


let config = {
    type: Phaser.CANVAS,
    scale: {
        mode: Phaser.Scale.FIT,
        autoCenter: Phaser.Scale.CENTER_BOTH,
        width: 1800,
        height: 1e3
    },
    transparent: !0,
    scene: Example
};
let game = new Phaser.Game(config)
  